import React from 'react';

const NavBar = () => {
    return (
        <div className="navbar">
            <ul className="nav-sections">
                <li>Search</li>
                <li>Saved Profiles</li>
                <li>Profile</li>
            </ul>
        </div>
    );
};

export default NavBar;
